import React from 'react'

export default function Certificates() {
  return (
    <div className = "certificate">
    <hr></hr>
        <h3>Certificates</h3>
        <p>
            <ul>
                <li>HackerRank Problem Solving(Basic) - 
                <a href = "https://www.hackerrank.com/certificates/01db8d09e440" target = "_blank" rel = "noopener noreferrer"> HackerRank</a> 
                </li>

                <li>HackerRank Problem Solving(Intermediate) - 
                <a href = "https://www.hackerrank.com/certificates/e3e0af2951a9" target = "_blank" rel = "noopener noreferrer"> HackerRank</a> 
                </li>

                <li>HackerRank SQL (Basic) - 
                <a href = "https://www.hackerrank.com/certificates/24413e7db549" target = "_blank" rel = "noopener noreferrer"> HackerRank</a> 
                </li>

                <li>HackerRank SQL (Intermediate) - 
                <a href = "https://www.hackerrank.com/certificates/24413e7db549" target = "_blank" rel = "noopener noreferrer"> HackerRank</a> 
                </li>

                <li>AWS Academy Graduate - 
                <a href = "https://www.hackerrank.com/certificates/01db8d09e440" target = "_blank" rel = "noopener noreferrer"> HackerRank</a> 
                </li>

            </ul>
        </p>

        <style>
            {`
             .certificate{
                text-align: left;
                background-color: #f0f0f0;
                padding: 10px;
             }

             .certificate hr{
                order-width: 2px;
                font-weight: bold;
             }

             .certificate h3{
                font-size: 25px;
                font-style : 'Times New Roman',Times,sans,serif;
                color:#333;
                position : relative;
                display : inline-block;
             }

             .certificate h3::after{
                content: "";
                position: absolute;
                left: 0;
                bottom: -5px; /* Adjust this value to control line position */
                width: 100%;
                height: 2px;
                background-color: #333;
             }
            
            `}
        </style>
    </div>
  )
}
